package model.jsoninfo;

public class hakaTLA {
	private String year;
	private String award_categories;
	private String rank;
	private String author;
	private String works_name;
	public hakaTLA() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getYear() {
		return year;
	}
	public void setYear(String year) {
		this.year = year;
	}
	public String getAward_categories() {
		return award_categories;
	}
	public void setAward_categories(String award_categories) {
		this.award_categories = award_categories;
	}
	public String getRank() {
		return rank;
	}
	public void setRank(String rank) {
		this.rank = rank;
	}
	public String getAuthor() {
		return author;
	}
	public void setAuthor(String author) {
		this.author = author;
	}
	public String getWorks_name() {
		return works_name;
	}
	public void setWorks_name(String works_name) {
		this.works_name = works_name;
	}
	
	
	
	
}
